DROP TABLE IF EXISTS `synthesis_product`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `synthesis_product` (
  `PRODUCT` varchar(500) NOT NULL COMMENT 'Продукт реакции',
  `PRODUCT_ID` int NOT NULL COMMENT 'ID в базе данных',
  `DOI` varchar(500) NOT NULL COMMENT 'DOI',
  `A_PARAMETER_MAX` double DEFAULT NULL COMMENT 'Минимальное значение параметра а кубической фазы',
  `A_PARAMETER_MIN` double DEFAULT NULL COMMENT 'Максимальное значение параметра а кубической фазы',
  `MIXING_METHOD` varchar(500) DEFAULT NULL COMMENT 'Метод смешивания',
  `SOURCE_MIX_TIME_MIN` double DEFAULT NULL COMMENT 'Минимальное значение времени смешивания сырья, часы',
  `SOURCE_MIX_TIME_MAX` double DEFAULT NULL COMMENT 'Максимальное значение времени смешивания сырья, часы',
  `METHOD` varchar(500) DEFAULT NULL COMMENT 'Метод синтеза и теоретических исследований',
  `GAS` varchar(500) DEFAULT NULL COMMENT 'Защитный газ',
  `SYNTHESIS_TIME_MIN` double DEFAULT NULL COMMENT 'Минимальное значение времени синтеза, минуты',
  `SYNTHESIS_TIME_MAX` double DEFAULT NULL COMMENT 'Максимальное значение времени синтеза, минуты',
  `FEATURE` varchar(500) DEFAULT NULL COMMENT 'Признак работы',
  `CONTRIBUTOR` varchar(500) DEFAULT NULL COMMENT 'ФИО вписавшего',
  `COMMENTS` varchar(500) DEFAULT NULL COMMENT 'Комментарии',
  PRIMARY KEY (`PRODUCT_ID`,`DOI`),
  KEY `PRODUCT_ID` (`PRODUCT_ID`),
  KEY `DOI` (`DOI`),
  CONSTRAINT `BIB_PROD` FOREIGN KEY (`DOI`) REFERENCES `bibliography` (`DOI`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb3;
/*!40101 SET character_set_client = @saved_cs_client */;

